//get API data for cat of the day

const pic = newsartapril01
const epsNews = () => {


  return (
    <div className={styles.epsnews}>
      <div className={styles.notes}>
      </div>
      <img src={pic}></img>
      <p>Check out the cat surfer!!<br></br>
      Click the button to surf Cats!</p>

    </div>
  );
};

export default epsNews;
